    public function generatePDF($id)
    {
        $clientService = ClientService::findOrFail($id);
        $paymentRecord = PaymentRecord::where('client_deposit_id', $clientService->id)
            ->latest()
            ->first();
        $servicesAvailed = ServicesAvailed::where('client_deposit_id', $clientService->id)
            ->orderBy('pet_id', 'desc')->get();
        $meds = Medication::whereIn('services_availed_id', $servicesAvailed->pluck('id'))
            ->orderBy('id', 'desc')
            ->get();

        $html = $this->generateHTML(ServicesAvailedResource::collection($servicesAvailed), $clientService, $paymentRecord, MedicationResource::collection($meds));

        $dompdf = new Dompdf();

        $dompdf->loadHtml($html);

        $dompdf->setPaper('A4', 'portrait');

        $dompdf->render();

        // Return the generated PDF as a response
        return response($dompdf->output(), 200)
            ->header('Content-Type', 'application/pdf')
            ->header('Content-Disposition', 'attachment; filename="generated_pdf.pdf"');
    }

