    public function generatePDFClientDeposits($date)
    {
        $timestamp = strtotime($date);

        $deposits = ClientService::whereDate('date', '=', date('Y-m-d', $timestamp))->where('deposit', '!=', 0)
            ->get();

        $totalDeposit = $deposits->sum('deposit');

        $html = $this->generateHTMLClientDeposits(ClientServiceResource::collection($deposits), $totalDeposit, $timestamp);

        $dompdf = new Dompdf();

        $dompdf->loadHtml($html);

        $dompdf->setPaper('A4', 'portrait');

        $dompdf->render();

        // Return the generated PDF as a response
        return response($dompdf->output(), 200)
            ->header('Content-Type', 'application/pdf')
            ->header('Content-Disposition', 'attachment; filename="generated_pdf.pdf"');
    }

