            ->latest()
            ->first();

        $servicesAvailed = ServicesAvailed::where('client_deposit_id', $clientService->id)
            ->orderBy('pet_id', 'desc')->get();

        $html = $this->generateHTMLBalancePaid(ServicesAvailedResource::collection($servicesAvailed), $clientService, $lastpaymentRecord, $latestpaymentRecord,);

        $dompdf = new Dompdf();

        $dompdf->loadHtml($html);

        $dompdf->setPaper('A4', 'portrait');

        $dompdf->render();

        // Return the generated PDF as a response
        return response($dompdf->output(), 200)
            ->header('Content-Type', 'application/pdf')
            ->header('Content-Disposition', 'attachment; filename="generated_pdf.pdf"');
    }

