    // generate treatment sheet
    public function generatePDFTreatment($id)
    {
        $treatment = Treatment::findOrFail($id);
        $petcondition = PetCondition::where('treatment_id', $treatment->id)->get();
        $medication = Medication::where('treatment_id', $treatment->id)->get();

        $pet = Pet::where('id', $treatment->pet_id)->first();
        $petowner = PetOwner::where('id', $pet->petowner_id)->first();

        $treatmentResource = new TreatmentResource($treatment);
        $petconditionResource = PetConditionResource::collection($petcondition);
        $medicationResource = MedicationResource::collection($medication);

        $html = $this->generateHTMLTreatment($treatmentResource, $petconditionResource, $medicationResource, $pet, $petowner);

        $dompdf = new Dompdf();

        $dompdf->loadHtml($html);

        $dompdf->setPaper('A4', 'portrait');

        $dompdf->render();

        // Return the generated PDF as a response
        return response($dompdf->output(), 200)
            ->header('Content-Type', 'application/pdf')
            ->header('Content-Disposition', 'attachment; filename="treatment-generated_pdf.pdf"');
    }

